      >
        You Are Welcome
      </Typography>
      <Typography
        variant="h6"
        component="h1"
        noWrap
        sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}
      >
        YRW
      </Typography>
      <Button
          color="inherit"
          startIcon={<Lock />}
          
        >
          Login
        </Button>
      
    </Toolbar>
  </Container>
</AppBar>
<Toolbar />
</>
    );
}

export default Header;
